import axios from 'axios';
import React, { useState, useEffect } from 'react';

const DogWalkersList = () => {
  const [dogWalkers, setWalkers] = useState([]);
  useEffect(() => {
    getDogWalkers();
  }, []);
  const getDogWalkers = () => {
    axios.get('http://127.0.0.1:8000/api/dogWalkers')
    .then((res) => {
      console.log(res);
      setWalkers(res.data);
    })
    .catch((err) => {
      console.log(err);
    });
  }
};

function App() {
  return (
    <div id="dogWalkers"></div>
  );
}

export default App;


